> Top News For Indonesian leader, a chance to build rapport with Obama FILE - In this Aug. 14, 2015 file photo, Indonesian President Joko "Jokowi" Widodo applauds prior to speaking before Parliament members ahead of the country's Independence Day in Jakarta, Indonesia. Widodo makes his first White House visit Oct. 26 since sweeping to power a year ago. It’s a chance to build a rapport with an American president with personal ties to his country, and to persuade American companies that he’ll make it easier to invest in Southeast Asia’s biggest economy. (AP Photo/Tatan Syuflana, File) 
